		public static IEnumerable<Appointment> FeedAppointments(IDataLayer dataLayer, IEnumerable<Patient> patients)
		{
			Random rnd = new Random();
			
			var appointmentStore = new AppointmentStore(XpoHelper.GetDataLayer());
			if (!appointmentStore.Query().Any()) 
			{
				var appointments = new List<Appointment>();

				foreach (var patient in patients)
				{
					for (var i = 0; i < rnd.Next(1, 6); i++)
					{
						var appointment = new Appointment();
						appointment.PatientId = patient.Oid;						
						DateTime startDate = default;
						do
						{
							startDate = DateTime.Now.AddDays(rnd.Next(-365, 365)).Date
									.AddHours(rnd.Next(9, 16))
									.AddMinutes(rnd.Next(0, 3) * 15);
						} while (appointments.FindAll(a => a.Date >= startDate && a.EndDate <= startDate).Any());

						appointment.Date = startDate;
						appointment.Duration = rnd.Next(1, 4) * 15;
						appointment.Status = appointment.Date > DateTime.Now
												? AppointmentStatus.Open
												: (rnd.Next(0, 2) == 0 ? AppointmentStatus.Completed : AppointmentStatus.Failed);
						appointments.Add(appointment);
					}
				}

				var result = appointmentStore.CreateAsync(appointments.ToArray()).Result;
				if (!result.Success)
					throw result.Exception;

				return appointments;
			}
			return null;
		}

		public static IEnumerable<Patient> FeedPatients(IDataLayer dataLayer)
		{
			var store = new PatientStore(dataLayer);
			if (!store.Query().Any())
			{
				Patient[] patients = new Patient[SamplePatients.Length];
				SamplePatients.CopyTo(patients, 0);

				store.CreateAsync(patients);
				return patients;
			}

			return null;
		}

